/*
 * alive 값이 true이면 각 스레드는 무한 루프를 돌며 반복해서 일을 하고,
 * alive 값이 false가 되면 무한 루프를 빠져나와 스레드를 자연스럽게 종료한다.
 */
bool alive = true;
pthread_mutex_t mutex; // 상호베타가 필요하므로 사용하는 뮤텍스
pthread_cond_t r_mutex; // reader의 동기화를 위한 조건 변수
pthread_cond_t w_mutex; // writer의 동기화를 위한 조건 변수
int read_count = 0; // 현재 돌아가고 있는 reader 수
int write_count = 0; // 현재 돌아가고 있는 writer 수
int write_first = 0; // writer 선호방식을 위해 추가된 변수
/*
 * Reader 스레드는 같은 문자를 L0번 출력한다. 예를 들면 <AAA...AA> 이런 식이다.
 * 출력할 문자는 인자를 통해 0이면 A, 1이면 B, ..., 등으로 출력하며, 시작과 끝을 <...>로 나타낸다.
 * 단일 reader라면 <AAA...AA>처럼 같은 문자만 출력하겠지만, critical section에서 reader의
 * 중복을 허용하기 때문에 reader가 많아지면 출력이 어지럽게 섞여서 나오는 것이 정상이다.
 */
void *reader(void *arg)
{
    int id, i;

    /*
     * 들어온 인자를 통해 출력할 문자의 종류를 정한다.
     */
    id = *(int *)arg;
    /*
     * 스레드가 살아 있는 동안 같은 문자열 시퀀스 <XXX...XX>를 반복해서 출력한다.
     */
    while (alive) {
        /*
         * writer가 진행중이라면 reader는 writer가 쓸 때까지 기다려야 한다. 또한 writer선호 방식이므로 write_first가 0보다 크면 write 먼저 써야되므로 reader는 기다린다.
         * 반복문을 통과하면 reader가 쓸 차례이므로 read_count 1 증가, 상호베타를 위해 뮤텍스 락을 걸고 진행한다.
         */
        pthread_mutex_lock(&mutex);
        while(write_count > 0 || write_first > 0)
            pthread_cond_wait(&r_mutex, &mutex);
        read_count++;
        pthread_mutex_unlock(&mutex);
        /*
         * Begin Critical Section
         */
        printf("<");
        for (i = 0; i < L0; ++i)
            printf("%c", 'A'+id);
        printf(">");
        /*
         * End Critical Section
         */
        /*
         * 상호 베타를 위해 뮤텍스 락을 걸고 진행하며, reader가 끝났으므로 read_count 1 감소한다.
         * read_count가 0이면 더 이상 reader가 없으므로 writer를 허용한다.
         */
        pthread_mutex_lock(&mutex);
        read_count--;
        if(read_count == 0)
            pthread_cond_signal(&w_mutex);
        pthread_mutex_unlock(&mutex);
    }
    pthread_exit(NULL);
}

/*
 * Writer 스레드는 어떤 사람의 얼굴 이미지를 출력한다.
 * 이미지는 여러 종류가 있으며 인자를 통해 식별한다.
 * Writer가 critical section에 있으면 다른 writer는 물론이고 어떠한 reader도 들어올 수 없다.
 * 만일 이것을 어기고 다른 writer나 reader가 들어왔다면 얼굴 이미지가 깨져서 쉽게 감지된다.
 */
void *writer(void *arg)
{
    int id, i;
    struct timespec req;

    /*
     * 들어온 인자를 통해 얼굴 이미지의 종류를 정한다.
     * 랜덤 생성기의 시드 값을 현재 시간으로 초기화한다.
     */
    id = *(int *)arg;
    srand(time(NULL));
    /*
     * 스레드가 살아 있는 동안 같은 이미지를 반복해서 출력한다.
     */
    while (alive) {
        /*
         * 상호베타를 위해 뮤텍스 락을 걸고 진행하며, read_count가 0보다 크거나 write_count가 0보다 크면 reader나 writer가 쓰고 있다는 뜻으로 writer는 기다린다.
         * 락에 걸자마자 write_first에 1을 증가시키면서 reader를 대기시키고 write 먼저 쓰게 만든다.
         * 반복문을 통과하면 writer가 쓸 차례이므로 write_count 값을 1 증가한다.
         * 또한 반복문을 통과했으므로 writer_first의 값을 1 감소한다.
         */
        pthread_mutex_lock(&mutex);
        write_first++;
        while(read_count > 0 || write_count > 0)
            pthread_cond_wait(&w_mutex, &mutex);
        write_count++;
        write_first--;
        pthread_mutex_unlock(&mutex);
        /*
         * Begin Critical Section
         */
        printf("\n");
        switch (id) {
            case 0:
                for (i = 0; i < L1; ++i)
                    printf("%s\n", img1[i]);
                break;
            case 1:
                for (i = 0; i < L2; ++i)
                    printf("%s\n", img2[i]);
                break;
            case 2:
                for (i = 0; i < L3; ++i)
                    printf("%s\n", img3[i]);
                break;
            case 3:
                for (i = 0; i < L4; ++i)
                    printf("%s\n", img4[i]);
                break;
            case 4:
                for (i = 0; i < L5; ++i)
                    printf("%s\n", img5[i]);
                break;
            default:
                ;
        }
        /*
         * End Critical Section
         */
        /*
         * 상호베타를 위해 뮤텍스락을 걸고 진행하며, writer가 끝났으므로 write_count의 값을 1 감소시킨다.
         * write가 끝나고 다음 write를 불러와야하므로 signal을 통해 write를 불러오고 모든 writer가 끝나면 모든 reader 깨워주어야하므로 cond_broadcast를 통해 모든 reader를 깨워준다.
         */
        pthread_mutex_lock(&mutex);
        write_count--;
        pthread_cond_signal(&w_mutex);
        pthread_cond_broadcast(&r_mutex); // 여기서 signal을 사용하면 모든 reader가 아닌 한개의 reader만 깨워주므로 데드락에 걸리게된다.
        pthread_mutex_unlock(&mutex);
        /*
         * 이미지 출력 후 SLEEPTIME 나노초 안에서 랜덤하게 쉰다.
         */
        req.tv_sec = 0;
        req.tv_nsec = rand() % SLEEPTIME;
        nanosleep(&req, NULL);
    }
    pthread_exit(NULL);
}

/*
 * 메인 함수는 NREAD 개의 reader 스레드를 생성하고, NWRITE 개의 writer 스레드를 생성한다.
 * 생성된 스레드가 일을 할 동안 0.2초 동안 기다렸다가 alive의 값을 0으로 바꿔서 모든 스레드가
 * 무한 루프를 빠져나올 수 있게 만든 후, 스레드가 자연스럽게 종료할 때까지 기다리고 메인을 종료한다.
 */
int main(void)
{
    int i;
    int rarg[NREAD], warg[NWRITE];
    pthread_t rthid[NREAD];
    pthread_t wthid[NWRITE];
    struct timespec req;
    
    pthread_mutex_init(&mutex, NULL); // 뮤텍스 초기화
    pthread_cond_init(&r_mutex, NULL); // reader 동기화를 위해 조건 변수 초기화
    pthread_cond_init(&w_mutex, NULL); // writer 동기화를 위해 조건 변수 초기화
   
    /*
     * Create NREAD reader threads
     */
    for (i = 0; i < NREAD; ++i) {
        rarg[i] = i;
        if (pthread_create(rthid+i, NULL, reader, rarg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }
    /*
     * Create NWRITE writer threads
     */
    for (i = 0; i < NWRITE; ++i) {
        warg[i] = i;
        if (pthread_create(wthid+i, NULL, writer, warg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }
    /*
     * Wait for RUNTIME nanoseconds while the threads are working
     */
    req.tv_sec = 0;
    req.tv_nsec = RUNTIME;
    nanosleep(&req, NULL);
    /*
     * Now terminate all threads and leave
     */
    alive = false;
    for (i = 0; i < NREAD; ++i)
        pthread_join(rthid[i], NULL);
    for (i = 0; i < NWRITE; ++i)
        pthread_join(wthid[i], NULL);
    
    pthread_mutex_destroy(&mutex); // 뮤텍스 제거
    pthread_cond_destroy(&r_mutex); // reader 조건 변수 제거
    pthread_cond_destroy(&w_mutex); // writer 조건 변수 제거
    
    return 0;
}
